One thing that works for me @Keshav Bidawatka is listing down everything! Recently I've begun to use notion but my favourite is a simple pen and paper. 

Just create a space (page in a diary/word doc) for you to list down all your activities. This helps declutter your mind and when you see everything in one place, it's easier to execute the tasks. I even write small things like order a fruit, call a friend or make a list! Ticking off tasks on your list is the most satisfying feeling ever!

@chachacha try using a journal/word doc for separate things such as - listing down all your tasks and another one to list down all your worries and so on. See if it helps!

