Hey @Mohit !
I took a glance at your project's code, and here's few things can you please talk about ?

1.) 
```
def Update(request,pk=0):
    if request.method == "POST":
        particularBlog = Blogs.objects.get(pk= pk)
        update = BlogForm(request.POST, request.FILES ,instance = particularBlog)
        if update.is_valid():
            update.save()
            return redirect("/blog")

    particularBlog = Blogs.objects.get(pk= pk)
    content = BlogForm(instance=particularBlog)
    info = {'content':content}
    return render(request,"update.html",info)
```

Why did you user pk=0 while talking the parameters for your `Update` method?

2.) 

```
def BlogsView(request):
    if request.method == 'GET':
        blogs = Blogs.objects.all()
        serializer = blogDataSerializer(blogs,many= "Ture")
        return Response(serializer.data)

    elif request.method == 'POST':
        serializer = blogDataSerializer(data=request.data)
        if serializer.is_valid():
            serializer.save()
            return Response(serializer.data, status=status.HTTP_201_CREATED)
        return Response(serializer.errors, status=status.HTTP_400_BAD_REQUEST)
```

You have used `serializer = blogDataSerializer(blogs,many= "Ture")`, Here I'm not sure how is your this part of code justified ?

can you put some more light ?

ps - infact your spelling of `"True"` also seems to be wrong

